;===============================================================================
;  Application specific configuration
;===============================================================================
[simulator]
cycle_flag: CYCLE
objdebug_flag: OBJDEBUG
runtype: 2
; 1 - full call context
; 2 - stack only mode
simulator_exe: /data/rveroy/pulsrc/etanalyzer-cpp/BUILD/simulator
; ORIG simulator_exe: /data/rveroy/pulsrc/etanalyzer-cpp/simulator
simulator_exe_type1: /data/rveroy/pulsrc/etanalyzer-cpp/simulator-type1
simulatorGC: /data/rveroy/pulsrc/etanalyzer-cpp/0-simulator-GC/simulator-GC
sim_work_dir: /data/rveroy/pulsrc/etanalyzer-cpp/MYWORK/RUNSIM/
simGC_work_dir: /data/rveroy/pulsrc/etanalyzer-cpp/MYWORK/RUNSIMGC/
simulator_findmain_exe: /data/rveroy/pulsrc/etanalyzer-cpp/simulator-find-main
; For multiprocessing flag, only true will enable. Everything else will
; set off single threaded mode. Feel free to fix this in run_simulator.py
multiprocessing: true

[cycle-analyze]
directory: /data/rveroy/pulsrc/etanalyzer/MYWORK/z-SUMMARY/

[dgroups-analyze]
; Is 'directory' being used in dgroups_analyze-MPR.py? - RLV
directory: /data/rveroy/pulsrc/etanalyzer/MYWORK/z-SUMMARY/DGROUPS
output: /data/rveroy/src/trace_drop/dgroup_analyze
gml_files: /data/rveroy/src/trace_drop/dgroup_analyze/GML
backup: /data/rveroy/src/trace_drop/dgroup_analyze/BAK
dumpall: True
; filterbytes: 8388608
; filterbytes: 4194304
; 0 filterbytes means don't filter anything
filterbytes: 4194304

[simplelist-analyze]
output: /data/rveroy/src/trace_drop/simplelist_analyze
backup: /data/rveroy/src/trace_drop/simplelist_analyze/BAK
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
filterbytes: 4194304

[summarize-objectinfo]
output: /data/rveroy/src/trace_drop/summarize_objectinfo
backup: /data/rveroy/src/trace_drop/summarize_objectinfo/BAK
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
filterbytes: 0

[create-supergraph]
output: /data/rveroy/src/trace_drop/create_supergraph
backup: /data/rveroy/src/trace_drop/create_supergraph/BAK
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
filterbytes: 0
use_objinfo_db: True
use_edgeinfo_db: False

[csvinfo2db]
;; Output of the csvinfo2db script. That is, the sqlite
;; database version of *-OBJECTINFO.txt, *-EDGEINFO.txt, and *-STABILITY.
output: /data/rveroy/src/trace_drop/csvinfo2db
backup: /data/rveroy/src/trace_drop/csvinfo2db/BAK
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
filterbytes: 0

[dgroups2db]
;; Output of the dgroups2db script. That is, the sqlite
;; database version of *-OBJECTINFO.txt, *-EDGEINFO.txt, and *-STABILITY.
output: /data/rveroy/src/trace_drop/dgroups2db
backup: /data/rveroy/src/trace_drop/dgroups2db/BAK
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
filterbytes: 0
file-group2list: -DGROUPS-group2list.csv 
file-obj2group: -DGROUPS-obj2group.csv
file-dgroups: -DGROUPS.pickle

[analyze-dgroup]
;; Output of the analyze_dgroup script. That is, the sqlite
;; database version of *-OBJECTINFO.txt, *-EDGEINFO.txt, and *-STABILITY.
output: /data/rveroy/src/trace_drop/analyze_dgroup
backup: /data/rveroy/src/trace_drop/analyze_dgroup/BAK
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
filterbytes: 0
; See dgroups2db for the relevant input files
;     file-group2list
;     file-obj2group
;     file-dgroups


[run-GCsim]
;; Output of the run_RCsim.py script.
output: /data/rveroy/src/trace_drop/run_GCsim
backup: /data/rveroy/src/trace_drop/run_GCsim/BAK
file-output-template: -simulator-GC.txt
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
;
; 'initial_buffer is how much extra space is added to the
; starting size for the heap. That is:
; Heap is (100 + X)% of the max_live_size as taken from the SummaryReader.
initial_buffer: 5
; 'maximum' is the maximum size of the heap.
; If equal to 0 then increase the heap until there are not more collections
; If greater than 0 then increase the heap until that maximum, where the maximum
;      is interpreted to be a multiple of the heap IN PERCENTAGE. This is to 
;      make it consistent with 'initial_buffer'.
maximum: 0
step: 5
; 'step' is used as a percentage and is computed once using the initial buffer size
; in bytes. That is, if initial buffer is B and step is S, then the step increment to the heap
; is:  S% * B
; 
; Number of processes per benchmark
number-procs-per-benchmark: 3

[summarize-stability]
output: /data/rveroy/src/trace_drop/summarize_stability
backup: /data/rveroy/src/trace_drop/summarize_stability/BAK
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
filterbytes: 0
use_objinfo_db: True

[gcsim-graph]
;; Output of the run_RCsim.py script.
output: /data/rveroy/src/trace_drop/gcsim_graph
backup: /data/rveroy/src/trace_drop/gcsim_graph/BAK
file-output-template: -gcsim-graph.txt
; Filter out objects that live less than 'filterbytes' bytes 
;   (time is in allocation bytes)
; filterbytes: 4194304
;
; MAYBE TODO ; Number of processes per benchmark
; MAYBE TODO number-procs-per-benchmark: 5

;===============================================================================
;  END Application specific configuration
;===============================================================================

